1.body:
We assume that you are a somewhat familiar with Rust, and that you know how to create a Rust application with cargo new. The Rust Getting Started Guide can help you get set up. First, we create a new cargo project: cargo new memory
cd memory Then we edit Cargo.toml to add the sixtyfps dependency: [package]
#...
edition = "2018"
resolver = "2" [dependencies]
sixtyfps = "0.1.1" The resolver = "2" line is there to avoid some errors because of conflicting dependencies on some platforms. Finally we copy the hello world program from the SixtyFPS documentation into our src/main.rs: fn main() { MainWindow::new().run();
}
sixtyfps::sixtyfps! { MainWindow := Window { Text { text: "hello world"; color: green; } }
} We run this example with cargo run and a window will appear with the green "Hello World" greeting. Screenshot of initial tutorial app showing Hello World

2.body:
With the skeleton in place, let's look at the first element of the game, the memory tile. It will be the visual building block that consists of an underlying filled rectangle background, the icon image. Later we'll add a covering rectangle that acts as a curtain. The background rectangle is declared to be 64 logical pixels wide and tall, and it is filled with a soothing tone of blue. Note how lengths in the .60 language have a unit, here the px suffix. That makes the code easier to read and the compiler can detect when your are accidentally mixing values with different units attached to them. We copy the following code inside of the sixtyfps! macro: MemoryTile := Rectangle { width: 64px; height: 64px; background: #3960D5; Image { source: @image-url("icons/bus.png"); width: parent.width; height: parent.height; }
} MainWindow := Window { MemoryTile {}
} Inside the Rectangle we place an Image element that loads an icon with the @image-url() macro. The path is relative to the folder in which the Cargo.toml is located. This icon and others we're going to use later need to be installed first. You can download a Zip archive that we have prepared and extract it with the following two commands: curl -O https://sixtyfps.io/blog/memory-game-tutorial/icons.zip
unzip icons.zip This should unpack an icons directory containing a bunch of icons. Running the program with cargo run gives us a window on the screen that shows the icon of a bus on a blue background. Screenshot of the first tile

3.body:
Next, let's add a curtain like cover that opens up when clicking. We achieve this by declaring two rectangles below the Image, so that they are drawn afterwards and thus on top of the image. The TouchArea element declares a transparent rectangular region that allows reacting to user input such as a mouse click or tap. We use that to forward a callback to the MainWindow that the tile was clicked on. In the MainWindow we react by flipping a custom open_curtain property. That in turn is used in property bindings for the animated width and x properties. Let's look at the two states a bit more in detail: open_curtain value: false true Left curtain rectangle Fill the left half by setting the width width to half the parent's width Width of zero makes the rectangle invisible Right curtain rectangle Fill the right half by setting x and width to half of the parent's width width of zero makes the rectangle invisible. x is moved to the right, to slide the curtain open when animated In order to make our tile extensible, the hard-coded icon name is replaced with an icon property that can be set from the outside when instantiating the element. For the final polish, we add a solved property that we use to animate the color to a shade of green when we've found a pair, later. We replace the code inside the sixtyfps! macro with the following: MemoryTile := Rectangle { callback clicked; property <bool> open_curtain; property <bool> solved; property <image> icon; height: 64px; width: 64px; background: solved ? #34CE57 : #3960D5; animate background { duration: 800ms; } Image { source: icon; width: parent.width; height: parent.height; } // Left curtain Rectangle { background: #193076; width: open_curtain ? 0px : (parent.width / 2); height: parent.height; animate width { duration: 250ms; easing: ease-in; } } // Right curtain Rectangle { background: #193076; x: open_curtain ? parent.width : (parent.width / 2); width: open_curtain ? 0px : (parent.width / 2); height: parent.height; animate width { duration: 250ms; easing: ease-in; } animate x { duration: 250ms; easing: ease-in; } } TouchArea { clicked => { // Delegate to the user of this element root.clicked(); } }
}
MainWindow := Window { MemoryTile { icon: @image-url("icons/bus.png"); clicked => { self.open_curtain = !self.open_curtain; } }
} Note the use of root and self in the code. root refers to the outermost element in the component, that's the MemoryTile in this case. self refers to the current element. Running this gives us a window on the screen with a rectangle that opens up to show us the bus icon, when clicking on it. Subsequent clicks will close and open the curtain again.

4.body:
After modeling a single tile, let's create a grid of them. For the grid to be our game board, we need two features: A data model: This shall be an array where each element describes the tile data structure, such as the url of the image, whether the image shall be visible and if this tile has been solved. We modify the model from Rust code. A way of creating many instances of the tiles, with the above .60 markup code. In SixtyFPS we can declare an array of structures using brackets, to create a model. We can use the for loop to create many instances of the same element. In .60 the for loop is declarative and automatically updates when the model changes. We instantiate all the different MemoryTile elements and place them on a grid based on their index with a little bit of spacing between the tiles. First, we copy the tile data structure definition and paste it at top inside the sixtyfps! macro: // Added:
struct TileData := { image: image, image_visible: bool, solved: bool,
} MemoryTile := Rectangle { Next, we replace the MainWindow := { ... } section at the bottom of the sixtyfps! macro with the following snippet: MainWindow := Window { width: 326px; height: 326px; property <[TileData]> memory_tiles: [ { image: @image-url("icons/at.png") }, { image: @image-url("icons/balance-scale.png") }, { image: @image-url("icons/bicycle.png") }, { image: @image-url("icons/bus.png") }, { image: @image-url("icons/cloud.png") }, { image: @image-url("icons/cogs.png") }, { image: @image-url("icons/motorcycle.png") }, { image: @image-url("icons/video.png") }, ]; for tile[i] in memory_tiles : MemoryTile { x: mod(i, 4) * 74px; y: floor(i / 4) * 74px; width: 64px; height: 64px; icon: tile.image; open_curtain: tile.image_visible || tile.solved; // propagate the solved status from the model to the tile solved: tile.solved; clicked => { tile.image_visible = !tile.image_visible; } }
} The for tile[i] in memory_tiles: syntax declares a variable tile which contains the data of one element from the memory_tiles array, and a variable i which is the index of the tile. We use the i index to calculate the position of tile based on its row and column, using the modulo and integer division to create a 4 by 4 grid. Running this gives us a window that shows 8 tiles, which can be opened individually.

5.body:
The tiles in the game should have a random placement. We'll need to add the <rand dependency to Cargo.toml for the randomization. [dependencies]
sixtyfps = "0.1.1"
rand = "0.8" # Added What we'll do is take the list of tiles declared in the .60 language, duplicate it, and shuffle it. We'll do so by accessing the memory_tiles property through the Rust code. For each top-level property, a getter and a setter function is generated - in our case get_memory_tiles and set_memory_tiles. Since memory_tiles is an array in the .60 language, it is represented as a Rc<dyn sixtyfps::Model> . We can't modify the model generated by the .60, but we can extract the tiles from it, and put it in a VecModel which implements the Model trait. VecModel allows us to make modifications and we can use it to replace the static generated model. We modify the main function like so: fn main() { use sixtyfps::Model; let main_window = MainWindow::new(); // Fetch the tiles from the model let mut tiles: Vec<TileData> = main_window.get_memory_tiles().iter().collect(); // Duplicate them to ensure that we have pairs tiles.extend(tiles.clone()); // Randomly mix the tiles use rand::seq::SliceRandom; let mut rng = rand::thread_rng(); tiles.shuffle(&mut rng); // Assign the shuffled Vec to the model property let tiles_model = std::rc::Rc::new(sixtyfps::VecModel::from(tiles)); main_window.set_memory_tiles(sixtyfps::ModelHandle::new(tiles_model)); main_window.run();
} Note that we clone the tiles_model because we'll use it later to update the game logic. Running this gives us a window on the screen that now shows a 4 by 4 grid of rectangles, which can show or obscure the icons when clicking. There's only one last aspect missing now, the rules for the game.
